syntax = "proto3";
package proto;
option go_package = "github.com/wyattanderson/googleapis-reproducer/proto";

import "google/cloud/vision/v1/geometry.proto";
import "google/protobuf/duration.proto";

message GoogleCloudVision {
    google.cloud.vision.v1.Vertex bounding_box = 1;
    google.protobuf.Duration duration = 2;
}
